import React from 'react';




export function Content(){
    return (
        <Content className='content'>
            <div className='row'>
                <div className='col'>1 of 4</div>
                <div className='col'>2 of 4</div>
                <div className='col'>3 of 4</div>
                <div className='col'>4 of 4</div>
            </div>
        </Content>
    )
}
